import React from 'react';

// import Slideshow from '../../components/slideshow/Slideshow';
import Slideshow from '@Components/slideshow/Slideshow';

import './Home.css';

function Home() {
	return (
		<section id='home'>
			<Slideshow />
			<h1>Société de désinsectisation, dératisation et désinfection près de Limoges (87)</h1>
			<h2>Service de Piégeage et dépigeonnage </h2>
		</section>
	);
}

export default Home;
